function DropWatermellon() {
  var height = window.innerHeight;

  let cat = randomNumber(0, 100);
  var qw = cat < 25 ? cat1() : cat < 50 ? getUncleRob() : cat22();
  //document.body.appendChild(rob);
  var melonElement = document.createElement("div");
  var text = document.createTextNode(document.getElementById("bar").value);
  melonElement.appendChild(text);
  // document.getElementById("app").append(melonElement);

  document.getElementById("foobar").append(qw);
  // document.getElementById("foobar").append(cat2);
  let left = randomNumber(5, window.innerWidth);
  let size = randomNumber(5, 80);
  for (let q = 0; q < height; q++) {
    setTimeout(function () {
      // foo(melonElement, q, left, size);

      foo(qw, q, left, size);

      if (q === height - 1) {
        qw.remove();
      }
    }, 10 * q);
  }
}

