// DropWatermellon()
function foo(element, top, left, size) {
  element.style =
    "font-size:" +
    size +
    "px;  position: absolute;  left: " +
    left +
    "px;  top: " +
    (top + 10) +
    "px;";
}

function randomNumber(min, max) {
  return Math.random() * (max - min);
}
